import { Card } from 'antd'
import React from 'react'


const EmployeeList = () => {
  return (
    <>
      <Card title={title}>
        <ListTa
          users={users}
          roles={roles}
          roleNames={roleNames}
          getUsers={getUsers}
          openUserForm={(user) => openUserForm('edit', user)}
          handleCancel={handleCancel}
        />
      </Card>
    </>
  )
}
export default EmployeeList
